    function removeDiacritics(input)
    {
        var output = "";
          
        input = input.replace(/\u0061\u0308/g, 'ae');
        input = input.replace(/\u006F\u0308/g, 'oe');
        input = input.replace(/\u0075\u0308/g, 'ue');
        input = input.replace(/\u00DF/g, 'ss');
        input = input.replace(/\u00E6/g, 'ae');
        input = input.replace(/\u0153/g, 'oe');
        input = input.replace(/\u00F8/g, 'oe');
        input = input.replace(/\u0027/g, '');
        var normalized = input.normalize("NFD");
        var i=0;
        var j=0;

        while (i<input.length)
        {
            output += normalized[j];

            j += (input[i] == normalized[j]) ? 1 : 2;
            i++;
        }

        return output;
    }
    
    function getCutter(input)
    {
        var auth_prev = ""
        var auth_aft = ""
        var cutter_prev = ""
        var cutter_aft = ""

        for (i = input.length; i >= 0 ; i--) {
            var index = authList.indexOf(input.substr(0,i));
            if (index != -1) {
                //console.log(cutter[index]);
                var len = authList[index+1].length
                while (input.substr(0,len) > authList[index+1])
                    index += 1
                    var cutter = cutterList[index]
                    auth_prev = authList[index-1]
                    auth_aft = authList[index+1]
                    cutter_prev = cutterList[index-1]
                    cutter_aft = cutterList[index+1]
                    break;
            };
        };
        
        return [cutter, auth_prev, auth_aft, cutter_prev, cutter_aft]
    }

